import React, { Component } from 'react';

class Product extends Component {
    render() {
        return (
            <div className="col-4">
                <div className="card text-left ">
                    <img className="card-img-top" src="https://vcdn-ngoisao.vnecdn.net/2020/05/15/96683961-2677555739022681-1336-3208-6920-1589539108_r_220x132.jpg" alt="" />
                    <div className="card-body">
                        <h5 className="card-title float-left">Tên Sản Phẩm</h5>
                        <h5 className="card-text float-right">50000</h5>
                    </div>
                </div>
            </div>
        );
    }
}

export default Product;
